function go(){var e=document.getElementById("prj-input-1").files[0];(new JSZip).loadAsync(e,{checkCRC32:!0,createFolders:!0}).then(function(e){e.file("INSTRUCTIONS.md").async("string").then(function(e){document.getElementById("_instructions").innerHTML=marked(e)},function(e){halfmoon.initStickyAlert({content:e,title:"error getting instructions",alertType:"alert-danger"})}),e.file("OBJECT.json").async("string").then(function(e){var t=JSON.parse(e);document.getElementById("info-title").innerHTML=t.title,document.getElementById("info-description").innerHTML=t.description,t.price=t.priceformat+t.price[0]+" - "+t.priceformat+t.price[1],document.getElementById("info-price").innerHTML=t.price,document.getElementById("info-date").innerHTML=t.date},function(e){halfmoon.initStickyAlert({content:e,title:"error getting instructions",alertType:"alert-danger"})})},function(e){halfmoon.initStickyAlert({content:e,title:"error reading file",alertType:"alert-danger"})})}